script: |
  super -f text -I q12809.spq | sort > q12809.out

inputs:
  - name: q12809.spq
    data: |
      SELECT DISTINCT - - CAST ( NULL AS REAL ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL >= CAST ( - + CAST ( - - col2 AS INTEGER ) AS REAL ) + + col1;
  - name: tab2

outputs:
  - name: q12809.out
    data: |
